import React, {Component} from 'react';
import BoilingVerdict from './BoilingVerdict'

class Calculator extends Component {
  render () {
    return (
      <fieldset>
        <legend>Enter temperature in Celsius</legend>
        <input type="text"/>
        <BoilingVerdict />
      </fieldset>
    )
  }
}

export default Calculator;
